import React from 'react';
import './App.css';
import { BrowserRouter, Route } from "react-router-dom";
import People from './components/people';

function App() {
  return (
    <BrowserRouter>
        <div>
          <Route exact path="/" component={People} />
        </div>
      </BrowserRouter>
  );
}

export default App;
